import React, { Component } from "react";
import "./App.css";
import User from "./User/User";

class App extends Component {
  render() {
    return (
      <div className="App">
        <p>This is the app Component</p>
        <User myUserData={() => this.whenSubComponentRender()} />
      </div>
    );
  }

  whenSubComponentRender() {
    console.log("another subcomponent rendered");
  }
}

export default App;
